function saveUserToDb(code){

    $.ajax({
        url: site_url + "login",
        type: "post",
        data: {
        code: code,
            ajax: true,
            type: 2
        },
        headers: { "Authorization": window.accessToken },
        dataType: "json",
        success: function(data){
        console.log(data);
        window.googleEmail = data.email;
        setCookie("googleEmail",data.email);
        if(data.success == "true"){
            setCookie("googleAT",data.googleAT);
            setCookie("googleRT",data.googleRT);

            if(window.loginAction == "addToYouTube"){
                $("#youtube_title").html("Add To YouTube Playlist");

                updateYoutubePlaylists(window.videoId,window.callback);
                $("#youtubePlaylistAddModal").modal("show");
            }

            if(window.loginAction == "onPlayerReady"){
                $("#youtube_title").html("Load YouTube Playlist");

                updateYoutubePlaylists(window.videoId,window.callback);
                onPlayerReady();
            }

            if(window.loginAction == "loadPlaylist"){
                updateYoutubePlaylists(window.videoId,window.callback)
                    $("#youtubePlaylistAddModal").modal("show");
                    $("#youtube_title").html("Load YouTube Playlist");

                }

            if(window.loginAction == "uploadedVideos"){
                updateUploadedVideos(true);
            }

            if(window.loginAction == "reload"){
                window.location.reload();
            }
            if(window.loginAction == "2")
            {
                window.loginFunction();
            }
            if(window.loginAction == "3")
            {
                window.loginFunction();
            }

            window.loginAction();
        }
        else{
            console.log("Login Failed;");
            alert("Login Failed:" + data.message);
        }

    }
    });
}


