                if(id != $(this).attr("video-id")){
                    window.backupSongs.push($(this).attr("video-id"));
                }
            });


            player.loadPlaylist(window.backupSongs,0);
        }
        catch(error){
            onYouTubeIframeAPIReady();
            window.current_video_id = id;
            setTimeout(loadPreview(id,id),2500);
        }

        window.suggestion_info = false;
        $(".suggestion_info").hide();

        // loadBackupSongs();

