function cueSong(video_id){
    window.video_id = video_id;
    if(getCookie("songsLikePlaylistId") || window.songsLikePlaylistId){

        if(getCookie("songsLikePlaylistId")){
            songsLikePlaylistId = getCookie("songsLikePlaylistId");
        }
        else{
            songsLikePlaylistId = window.songsLikePlaylistId;
        }

        $.gritter.add({
        title:  "Adding Song To Player",
        text: "This song is being added to your player",
        sticky: false,
        class_name: 'gritter-light'
    });
    var playlist = player.getPlaylist();
    var newPlaylist = [];
    if(playlist){
        for (var i = 0; i < playlist.length; i++) {
            newPlaylist.push(playlist[i]);
        }
    }
    newPlaylist.push(video_id);
    setCookie("defaultPlaylist",newPlaylist.join(","));
    setCookie("songsLikePlaylistId",songsLikePlaylistId);
    addToYouTubePlaylist(songsLikePlaylistId,video_id);


    player.loadPlaylist(newPlaylist,player.getPlaylistIndex(),player.getCurrentTime());
    $.gritter.add({
        title:  "Added",
        text: "This song will be played after the others songs in your player",
        sticky: false,
        class_name: 'gritter-light'
    });
         }
    else{
        window.loginAction = "cueSong";
        googleLogin();
    }
}


